enum Sound {
    SHOT = "external/shot.wav",
    WAD_SHOT = "WAD:shot"
}

class AudioManager {

    audioCache = {}

    play(sound: Sound, volume: number = 1) {
        if (!this.audioCache[sound]) {
            this.audioCache[sound] = this.newAudio(sound)
        }
        let audio = this.audioCache[sound]
        if (audio.paused || audio.ended) {
            audio.volume = volume
            audio.play()
        }
    }

    newAudio(sound: Sound) {
        if (sound.startsWith("WAD:")) {
            let binaryUrl = this.getBinaryURL(sound.substr(4))
            console.log(binaryUrl);
            return new Audio(binaryUrl)
        } else {
            return new Audio(sound);
        }
    }

    private base64sound = "";

    private getBinaryURL(name: string) {
        let array = this.base64ToBinary();
        let blob = new Blob([array]);
        return URL.createObjectURL(blob);
    }

    private base64ToBinary() {
        let raw = atob(this.base64sound);
        let rawLength = raw.length;
        let array = new Uint8Array(new ArrayBuffer(rawLength));
        for (let i = 0; i < rawLength; i++) {
            array[i] = raw.charCodeAt(i);
        }
        return array;
    }
}